import React, { useEffect } from 'react'
import Typography from '@mui/material/Typography'
import {Link as LinkRouter} from "react-router-dom"
import MenuItem from '@mui/material/MenuItem'

//importo los estilos


//importo acciones de redux
import {connect, useSelector, useDispatch} from 'react-redux';
import userActions from '../redux/actions/userActions'


function SignOut() {
    const dispatch = useDispatch()
    function signOut() {
        const user = useSelector(store=>store.userReducer.user.email)
        console.log(user)
        useEffect(()=>{
            dispatch(userActions.signOut(user))
        },[])
    }
    return ( //returno el HTML
        <MenuItem onClick={handleCloseUserMenu} key="signOut">
            <LinkRouter to={'/'}>
                <Typography onClick={signOut} textAlign="center">Log Out</Typography>
            </LinkRouter>
        </MenuItem>
    )
}

